class Solution:
    def removeReverse(self, S):
        print("Running for string S={S} of length {len}".format(S=S, len=len(S)))
        for i in range(0, len(S)-1):
            ch1 = S[i]
            print(f"Checking char {ch1} at index {i}")
            if ch1 in S[i+1:]:
                new_S = S[:i] + S[i+1:]
                new_S = new_S[::-1]
                print(f"Removed repeated char and reversing: {new_S}")
                if len(new_S) == 1:
                    return new_S
                else:
                    S = self.removeReverse(new_S)
                    break
            #else:
            #    return S

        return S


if __name__ == "__main__":
    #S = "ccced"
    S = ""

    ob = Solution()
    ans = ob.removeReverse(S)

    print(ans)
